package assets

import (
	"encoding/base64"
	"pure-kit/engine/internal"
	"pure-kit/engine/storage"
	"pure-kit/engine/window"

	rl "github.com/gen2brain/raylib-go/raylib"
)

func LoadDefaultTexture() string {
	return loadTexture("default-texture", baseTexture)
}
func LoadDefaultRetroAtlas() string {
	return loadTexture("default-retro-atlas", baseAtlas)
}
func LoadDefaultCursors() string {
	return loadTexture("default-cursors", baseCursors)
}
func LoadDefaultUserInterface() string {
	return loadTexture("default-user-interface", baseUserInterface)
}
func LoadDefaultInput() string {
	return loadTexture("default-input", baseInput)
}

// region private

func loadTexture(id, b64 string) string {
	if !rl.IsWindowReady() {
		window.Recreate()
	}

	var _, has = internal.Textures[id]
	if has {
		UnloadTextures(id)
	}

	var imgData, _ = base64.StdEncoding.DecodeString(b64)
	var decompressed = storage.Decompress(imgData)
	var image = rl.LoadImageFromMemory(".png", decompressed, int32(len(decompressed)))
	defer rl.UnloadImage(image)

	var tex = rl.LoadTextureFromImage(image)
	internal.Textures[id] = &tex
	return id
}

